[ BISNIS YANG FOKUS MEMBERI SOLUSI ]
.
APA Anda udah kenal bisnis #PayTren ? 
Sobat, janganlah Anda kalah dengan teman2 yang lebih dulu sukses di bisnis ini. PayTren adalah bisnis yang terbukti telah memberikan kesuksesan kepada ribuan mitranya. Banyak di antara mitra yang mempunyai penghasilan puluhan hingga ratusan juta setiap bulan. 
APA keuntungan ANDA menjadi MITRA PAYTREN ?
1. Anda secara otomatis menjadi mitra bisnis Ustadz Yusuf Mansur yang kredibilitasnya sudah sangat diakui ;
2. PayTren adalah bisnis yang sesuai syariah, halal, legalitasnya lengkap, transparan dan sangat adil ; 
3. PayTren fokus menjual produk digital berupa alat pembayaran (micropayment) secara online ;
4. Anda menjual produk digital TANPA harus ribet mengirim lewat ekspedisi ;
5. Produk PayTren dibutuhkan semua orang ; 
6. Pangsa pasar PayTren adalah seluruh Indonesia dan bahkan seluruh dunia ;
7. PayTren sudah berkembang di 17 negara ;
8. Ivestasi usaha hanya SEKALI seumur hidup dan bisnis ini bisa DIWARISKAN ;
9. Bisnis PayTren SANGAT MUDAH dilakukan oleh siapapun walaupun GAPTEK ;
10. Penghasilan mitra berupa 5 jenis KOMISI dan 9 jenis REWARD ;
11. Dengan PayTren Anda bisa gajian setiap MINGGU ;
12. PayTren didukung dengan teknologi internet yang canggih ;
13. PayTren menyediakan tools marketing / alat pemasaran yang sangat lengkap ;
14. Mitra PayTren bisa berbisnis secara MUDAH lewat ONLINE dan OFFLINE ;
15. Setiap mitra PayTren mendapatkan website secara GRATIS.
16. Dengan grup WhatsApp, Anda mendapatkan PEMBIMBINGAN BISNIS selamanya. . .
LALU Siapa yang bisa menjalankan bisnis PayTren ?
PayTren bisa dilakukan oleh siapapun tanpa memandang usia dan pendidikan :
a. Mahasiswa dan pelajar
b. Pegawai Negeri Sipil
c. Pegawai Swasta
d. Dosen / guru
e. Ibu rumah tangga
f.  Profesional : dokter, apoteker, pengacara, insinyur, konsultan, dll.
g. Dan siapapun yang suka berbisnis dengan SANGAT MUDAH.
